import React, { useEffect, useState } from 'react';
import { View, Text, StyleSheet, TouchableOpacity, Image, TextInput } from 'react-native';
import { useNavigation } from '@react-navigation/native';
import { URLaddress, loggedUser } from './App';
import { getContacts } from './Contact';
import { FontAwesome } from '@expo/vector-icons';

// Example data for chats and contacts
const exampleChats = [
  { id: 1, name: 'Alice', lastMessage: 'Hey, how are you?' },
  { id: 2, name: 'Jack', lastMessage: 'See you tomorrow!' },
  { id: 3, name: 'Lenny', lastMessage: 'Can you send me that file?' },
];

const exampleContacts = [
  { user_id: 1, first_name: 'Alice', last_name: 'Mc', email: 'alice@gmail.com' },
  { user_id: 2, first_name: 'Jack', last_name: 'Sparrow', email: 'jack@gmail.com' },
  { user_id: 3, first_name: 'Lenny', last_name: 'Stuart', email: 'lenny@gmail.com' },
];

// Define Chats component
function Chats() {
  return (
    <View style={styles.tabContent}>
      {exampleChats.map(chat => (
        <View key={chat.id} style={styles.chatItem}>
          <Text style={styles.chatName}>{chat.name}</Text>
          <Text style={styles.chatLastMessage}>{chat.lastMessage}</Text>
        </View>
      ))}
    </View>
  );
}

// Define Contacts component
function Contacts() {
  const [contacts, setContacts] = useState([]);
  const [showNewContactInput, setShowNewContactInput] = useState(false);
  const [newContactId, setNewContactId] = useState('');

  // Load contacts on mount
  useEffect(() => {
    getContacts(setContacts);
  }, []);

  // Function to handle creating a new contact
  const handleCreateContact = async () => {
    // Make sure new contact ID is a positive integer
    const id = parseInt(newContactId);
    if (isNaN(id) || id <= 0) {
      alert('Please enter a valid positive integer ID');
      return;
    }

    // Create new contact with given ID
    const success = await createContact(id);
    if (success) {
      // Reload contacts
      getContacts(setContacts);
      // Reset new contact input
      setShowNewContactInput(false);
      setNewContactId('');
    } else {
      alert('Error creating new contact');
    }
  };

  return (
    <View style={{ flex: 1 }}>
      <View style={{ flexDirection: 'row', justifyContent: 'space-between' }}>
        <Text style={{ fontSize: 20, fontWeight: 'bold', marginBottom: 10 }}>Contacts</Text>
        <TouchableOpacity style={{ backgroundColor: '#3498db', padding: 5, borderRadius: 5 }}
          onPress={() => setShowNewContactInput(true)}>
          <FontAwesome name="user-plus" size={20} color="#FFF" />
        </TouchableOpacity>
      </View>
      <View style={{ flex: 1 }}>
        {contacts.map(contact => (
          <View key={contact.user_id} style={{ paddingVertical: 10, borderBottomWidth: 1, borderBottomColor: '#ddd' }}>
            <Text style={{ fontSize: 16 }}>{contact.first_name} {contact.last_name}</Text>
            <Text style={{ color: '#999' }}>{contact.email}</Text>
          </View>
        ))}
      </View>
      {showNewContactInput && (
        <View style={{ flexDirection: 'row', alignItems: 'center', marginTop: 10 }}>
          <TextInput style={{ flex: 1, borderWidth: 1, borderColor: '#ddd', borderRadius: 5, padding: 5, marginRight: 5 }}
            placeholder="Enter new contact ID"
            value={newContactId}
            onChangeText={setNewContactId}
            keyboardType="numeric"
          />
          <TouchableOpacity style={{ backgroundColor: '#27ae60', padding: 5, borderRadius: 5 }}
            onPress={handleCreateContact}>
            <Text style={{ color: '#FFF' }}>Create</Text>
          </TouchableOpacity>
        </View>
      )}
    </View>
  );
}

function Profile() {
  const [name, setName] = useState('John');
  const [surname, setSurname] = useState('Doe');
  const [email, setEmail] = useState('john.doe@example.com');
  const [image, setImage] = useState(null);

  // handle input changes
  const handleNameChange = (text) => {
    setName(text);
  }

  const handleSurnameChange = (text) => {
    setSurname(text);
  }

  const handleEmailChange = (text) => {
    setEmail(text);
  }

  const handleImageChange = (event) => {
    const { uri } = event.nativeEvent;
    setImage(uri);
  }

  return (
    <View style={styles.tabContent}>
      <View style={styles.profileImageContainer}>
        {image ? (
          <Image source={{ uri: image }} style={styles.profileImage} />
        ) : (
          <FontAwesome name="user" size={100} color="#555" />
        )}
        <TouchableOpacity style={styles.editImageButton}>
          <Text style={styles.editImageButtonText}>Edit Image</Text>
          <TextInput style={styles.hiddenInput} onChange={handleImageChange} />
        </TouchableOpacity>
      </View>
      
      <View style={styles.profileInfo}>
        <TextInput
          style={styles.input}
          placeholder="Name"
          value={name}
          onChangeText={handleNameChange}
        />
        <TextInput
          style={styles.input}
          placeholder="Surname"
          value={surname}
          onChangeText={handleSurnameChange}
        />
        <TextInput
          style={styles.input}
          placeholder="Email"
          value={email}
          onChangeText={handleEmailChange}
        />
      </View>
    </View>
  );
}


export default function Home({navigation}) {
  
  const [activeTab, setActiveTab] = useState('Chats');

  return (
    <View style={styles.container}>
      {/* Nav bar */}
      <View style={styles.navBar}>
      <TouchableOpacity
          style={[styles.tabButton, activeTab === 'Profile' && styles.activeTabButton]}
          onPress={() => setActiveTab('Profile')}
        >
          {activeTab === 'Profile' ? (
      <Text style={[styles.tabButtonText, styles.activeTabButtonText]}>Profile</Text>
    ) : (
      <FontAwesome name="user-o" size={18} color="#fff" />
    )}
        </TouchableOpacity>
        <TouchableOpacity
          style={[styles.tabButton, activeTab === 'Chats' && styles.activeTabButton]}
          onPress={() => setActiveTab('Chats')}
        >
          {activeTab === 'Chats' ? (
      <Text style={[styles.tabButtonText, styles.activeTabButtonText]}>Chats</Text>
    ) : (
      <FontAwesome name="comments" size={18} color="#fff" />
    )}
        </TouchableOpacity>
        <TouchableOpacity
          style={[styles.tabButton, activeTab === 'Contacts' && styles.activeTabButton]}
          onPress={() => setActiveTab('Contacts')}
        >
          {activeTab === 'Contacts' ? (
      <Text style={[styles.tabButtonText, styles.activeTabButtonText]}>Contacts</Text>
    ) : (
      <FontAwesome name="address-book-o" size={18} color="#fff" />
    )}
        </TouchableOpacity>
        <TouchableOpacity onPress={() => navigation.navigate('Chat')}>
        <Text>Go to Chat screen</Text>
      </TouchableOpacity>
      </View>
  
      {/* Tab content */}
      {activeTab === 'Chats' ? <Chats /> : activeTab === 'Contacts' ? <Contacts /> : <Profile />}
    </View>
  );
  
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
  },
  navBar: {
    flexDirection: 'row',
    backgroundColor: '#007aff',
    height: 60,
  },
  tabButton: {
    flex: 1,
    justifyContent: 'center',
