    color: '#fff',
    fontSize: 18,
  },
  activeTabButton: {
    flex: 3,
    borderBottomWidth: 2,
    borderBottomColor: '#fff',
  },
  activeTabButtonText: {
    fontWeight: 'bold',
  },
  tabContent: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'flex-start',
  }, 
  input: {
    width: '100%',
    padding: 10,
    marginBottom: 10,
    backgroundColor: '#f0f0f0',
    borderWidth: 1,
    borderColor: '#ccc',
    borderRadius: 5,
    },
    imageContainer: {
    width: '100%',
    alignItems: 'center',
    marginBottom: 20,
    },
    profileImage: {
    width: 150,
    height: 150,
    borderRadius: 75,
    },
    changeImageButton: {
    backgroundColor: '#007aff',
    padding: 10,
    borderRadius: 5,
    marginTop: 10,
    },
    changeImageButtonText: {
    color: '#fff',
    textAlign: 'center',
    },
    form: {
    width: '100%',
    },
    label: {
    fontWeight: 'bold',
    marginBottom: 5,
    },
    submitButton: {
    backgroundColor: '#007aff',
    padding: 10,
    borderRadius: 5,
    marginTop: 20,
    },
    submitButtonText: {
    color: '#fff',
    textAlign: 'center',
    },
    profileName: {
    fontWeight: 'bold',
    fontSize: 18,
    marginTop: 20,
    },
    profileEmail: {
    color: '#777',
    fontSize: 14,
    marginTop: 5,
    },
    chatItem: {
      width: '100%',
      padding: 20,
      backgroundColor: '#f0f0f0',
      paddingTop: 20,
      borderBottomWidth: 1,
      borderBottomColor: '#ccc',
    },
    chatName: {
      fontWeight: 'bold',
      fontSize: 16,
      marginBottom: 5,
    },
    chatLastMessage: {
      color: '#777',
